import {useContext, useEffect} from "react";
import {AuthContext} from "./Authenticator";

export const SignOut = () => {
    const {userName, setUserName, setUserEmail} = useContext(AuthContext);
    useEffect(() => {
        setUserName("");
        setUserEmail("");
    }, [])

    return (
        <div>
            <h1>Signed out!</h1>
        </div>
    )
}

export default SignOut;
